(1, 'O nas', '<section id=\"banner\">\r\n    <br>\r\n    <img src=\"./img/banner.png\" id=\"logoo\" alt=\"\">\r\n    <div id=\"check\">\r\n          <button><a href=\"./index.php?id=1#about\">SPRWADŻ</a></button>\r\n    </div>\r\n</section>\r\n<section id=\"about\" class=\"text\">\r\n	<h1><b>O nas</b></h1>\r\n	<p>\r\n		<br />Kajaki, rowery, pole namiotowe, rzeka, las oraz duża zagospodarowana\r\n		działka, to jest to, co proponujemy naszym gościom. <br />\r\n		<br />Miejsce, do którego Państwa zapraszamy położone jest 100 km na północ\r\n		od Warszawy w miejscowości <b>Bieżany</b>(10km od trasy E7 Warszawa –\r\n		Gdańsk). <br />\r\n		<br />Urokliwy widok na rzekę ze wzgórza oraz bezpośredni dostęp Wkry i\r\n		lasu, nakłonił nas do założenia gospodarstwa agroturystycznego\r\n		“Agroturystyka w Bieżanach” oraz wypożyczalni kajaków “AGRO-KAJAK”. Oprócz\r\n		spływów kajakowych po rzece Wkrze i Mławce proponujemy skorzystać z noclegu\r\n		na dużym i profesjonalnie przygotowanym polu namiotowym.Komfortowy pobyt\r\n		zapewni rekreacyjnie zagospodarowana działka wraz z WC, natryskami, aneksem\r\n		kuchennym itp.\r\n		<center>\r\n			<br /><b\r\n				>Zachęcamy grupy do spływu kajakowego zakończonego posiłkiem / grillem /\r\n				ogniskiem lub zorganizowania u nas plenerowej imprezy integracyjnej</b\r\n			>\r\n		</center>\r\n	</p>\r\n	<br />\r\n	<b><p>To, co nas wyróżnia:</p></b>\r\n	<ul>\r\n		<li>Łatwy i atrakcyjny i bezpieczny szlak kajakowy</li>\r\n		<li>brak tłoku na rzece</li>\r\n		<li>\r\n			ciekawe przyrodniczo miejsce, wzbogacone wiedzą leśnika o przyrodzie,\r\n		</li>\r\n		<li>pragmatyczni gospodarze tworzący rodzinną atmosferę.</li>\r\n	</ul>\r\n	<a href=\"https://www.nasza-wkra.pl/\"\r\n		>Jesteśmy współzałożycielami Stowarzyszenia “Nasza Wkra”</a\r\n	>\r\n	<br /><br />\r\n	<p>\r\n		To nie jest zwykłe pole namiotowe. Każdy, kto lubi kontakt z naturą znajdzie\r\n		tu wiele atrakcji. Samo miejsce jest pięknie położone, rozciąga się z niego\r\n		widok na rozległe łąki oraz pobliski las.\r\n	</p>\r\n	<p>\r\n		To tutaj budząc się rano możemy usłyszeć żurawie, a wieczorem np. derkacza\r\n		lub rzekotkę. W nocy można obserwować niebo, a w czasie pełni księżyca widok\r\n		jest po prostu urzekający. Nietuzinkową atrakcją jest możliwość zobaczenia\r\n		torfowiska z wybijającym źródłem lub żeremie bobrów.\r\n	</p>\r\n	<p>\r\n		Spędzając wolny czas możemy skorzystać z kajaków lub wyruszyć w rowerową\r\n		przejażdżkę po malowniczych mazowieckich okolicach.\r\n	</p>\r\n	<center>\r\n		<img class=\"photos\"src=\"./img/12.jpg\" alt=\"\"/>\r\n		<img class=\"photos\"src=\"./img/5.jpg\" alt=\"\"/>\r\n		<img class=\"photos\"src=\"./img/11.jpg\" alt=\"\"/>\r\n	</center>\r\n</section>\r\n', 1),
(2, 'Spływy', '\r\n    <section id=\"splywy\" class=\"text\">\r\n        <br><h1><b>Spływy</b></h1> \r\n         <br>\r\n        <p><b>Propozycja spływów kilkudniowych z zaplanowanymi miejscami na nocleg:</b></p>\r\n        <p><b>Wariant I</b> - (77km)</p>\r\n        <p>1 dzień: Siciarz – Bieżany – 15 km (nocleg u nas na polu namiotowym)\r\n        2 dzień: Bieżany – Biwak pod lasem (Kuskowo) – 14 km (nocleg u rolnika na łące) <br>\r\n        3 dzień: Biwak pod lasem (Kuskowo) – Stary Garwarz – 14 km (nocleg u rolnika na łące) <br>\r\n        4 dzień: Stary Garwarz – Dziektarzewo – 14 km (nocleg u rolnika na łące) <br>\r\n        5 dzień: Dziektarzewo – Gutarzewo – 20 km <br>\r\n        </p>\r\n        <p><b>Wariant II</b> - (77km)</p>\r\n        <p>\r\n        1 dzień: Siciarz – Bieżany – 15 km (nocleg u nas na polu namiotowym) <br>\r\n        2 dzień: Bieżany – Biwak pod lasem (Szyjki) – 21 km (nocleg u rolnika na łące) <br>\r\n        3 dzień: Biwak pod lasem (Szyjki) – Dziektarzewo – 21 km (nocleg u rolnika na łące) <br>\r\n        4 dzień: Dziektarzewo – Gutarzewo – 20 km <br>\r\n        </p>\r\n        <p><b>Wariant III</b> - (117km)</p>\r\n        <p>\r\n        1 dzień: Bieżany – Biwak pod lasem (Kuskowo) – 14 km (nocleg u rolnika na łące) <br>\r\n        2 dzień: Biwak pod lasem (Kuskowo) – Stary Garwarz – 14 km (nocleg u rolnika na łące) <br>\r\n        3 dzień: Stary Garwarz – Dziektarzewo – 14 km (nocleg u rolnika na łące) <br>\r\n        4 dzień: Dziektarzewo – Gutarzewo – 20 km (nocleg na polu namiotowym) <br>\r\n        5 dzień : Gutarzewo – Sobieski  – 14 km (nocleg na polu namiotowym) <br>\r\n        6 dzień:  Sobieski – Śniadówko – 23 km (nocleg na polu namiotowym) <br>\r\n        7 dzień: Śniadówko – Modlin – 18 km <br>\r\n        </p>\r\n        <p><b>Wariant IV</b> - (117km)</p>\r\n        <p>\r\n        1 dzień: Bieżany – Biwak pod lasem (Szyjki) – 21 km (nocleg u rolnika na łące) <br>\r\n        2 dzień: Biwak pod lasem (Szyjki) – Dziektarzewo – 21 km (nocleg u rolnika na łące) <br>\r\n        3 dzień: Dziektarzewo – Gutarzewo – 20 km (nocleg na polu namiotowym) <br>\r\n        4 dzień: Gutarzewo – Joniec – 20 km (nocleg na polu namiotowym) <br>\r\n        5 dzień: Joniec – Śniadówko  17 km (nocleg na polu namiotowym) <br>\r\n        6 dzień: Śniadówko – Modlin – 18 km   <br>\r\n        </p>\r\n        <img class=\"photos\"src=\"./img/14.jpg\"  alt=\"\"/>\r\n        <img class=\"photos\"src=\"./img/16.jpg\"  alt=\"\"/>\r\n        <img class=\"photos\"src=\"./img/17.jpg\"  alt=\"\"/>\r\n    </section>\r\n', 1),
(3, 'Cennik', '    <section id=\"cennik\" class=\"text\">\r\n        <br><h1><b>Cennik</b></h1> <br>\r\n        <p>Posiadamy 1-2 osobowe polietylenowe kajaki  <b>Vista i Sprinter</b> z możliwością dostawki dla dziecka, wraz z wiosłami i kamizelkami asekuracyjnymi  (dla dzieci również).</p>\r\n    <ul>\r\n        <li>Wypożyczenie kajaka z „dostawką” dla dziecka – opłata dodatkowa 10zł</li>\r\n        <li>Cena za kajak jedno-osobowy jest mniejsza o 10zł od kajaka dwuosobowego</li>\r\n        <li>Wypożyczenie kajaka na miejscu do 3 godz. (wypłynięcie z przystani i powrót na nią) – 30zł</li>\r\n        <li>Parking dla samochodów jest bezpłatny.</li>\r\n        <li>Wypożyczenie kajaka na kilka dni już od 50 zł/doba, plus koszt transportu liczony wg. wskazań licznika w dwie strony 2 zł/km.</li>\r\n    </ul><br>\r\n    <b>Większym grupom proponujemy ofertę łączącą spływ kajakowy zakończony posiłkiem. Ceny uzależnione od menu.</b><br><br>\r\n        <center>\r\n        <table>\r\n            <thead>\r\n                <tr>\r\n                    <th>Trasa</th>\r\n                    <th>Długość i czas</th>\r\n                    <th>1-2 kajaki</th>\r\n                    <th>3 kajaki+</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr>\r\n                    <td> Radzanów – Bieżany</td>\r\n                    <td> 7 km ok. 2 godz.</td>\r\n                    <td> 70 zł</td>\r\n                    <td>55zł</td>\r\n                </tr>\r\n                <tr>\r\n                    <td>Ratowo <span style=\"font-style: normal; font-weight: 400;\">– </span>Bieżany</td>\r\n                    <td>9km ok. 3 godz.</td>\r\n                    <td>70zł </td>\r\n                    <td>60zł </td>\r\n                </tr>\r\n                <tr>\r\n                    <td> Siciarz – Bieżany</td>\r\n                    <td>15km ok. 4 godz. <br></td>\r\n                    <td>90zł </td>\r\n                    <td>70zł </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>Bieżany – Giełczyn <br></td>\r\n                    <td>5km ok. 2 godz. </td>\r\n                    <td>70zł </td>\r\n                    <td>55zł </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>Bieżany – Rydzyn Szt. <br></td>\r\n                    <td>10km ok. 3 godz.</td>\r\n                    <td>70zł </td>\r\n                    <td>60zł </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>Bieżany – Strzegowo <br></td>\r\n                    <td>12km ok. 4 godz. </td>\r\n                    <td>80zł </td>\r\n                    <td>65zł </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>Bieżany – Unierzyż <br></td>\r\n                    <td>19km ok. 6 godz. </td>\r\n                    <td>90zł </td>\r\n                    <td>75zł </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>Bieżany – Glinojeck <br></td>\r\n                    <td>27km ok. 8 godz. </td>\r\n                    <td>100zł </td>\r\n                    <td>85zł </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n        </center>\r\n        <center>\r\n            <img class=\"photos\"src=\"./img/6.jpg\" alt=\"\"/>\r\n            <img class=\"photos\"src=\"./img/7.jpg\" alt=\"\"/>\r\n            <img class=\"photos\"src=\"./img/13.jpg\" alt=\"\"/><br/><br/>\r\n        </center>\r\n    </section>\r\n', 1),
(4, 'Skrypty', '<body onload=\"startClock()\">\r\n\r\n    <section class=\"text\"><br><br>\r\n        <center><h1>Javascript</h1></center>\r\n        <form method=\"post\" name=\"background\" style=\"text-align: center;\">\r\n            <input type=\"button\" value=\"Żółty\" onclick=\"changeBackground(\'#fff000\')\">\r\n            <input type=\"button\" value=\"Czarny\" onclick=\"changeBackground(\'#000000\')\">\r\n            <input type=\"button\" value=\"Biały\" onclick=\"changeBackground(\'#ffffff\')\">\r\n            <input type=\"button\" value=\"Zielony\" onclick=\"changeBackground(\'#00ff00\')\">\r\n            <input type=\"button\" value=\"Niebieski\" onclick=\"changeBackground(\'#000ff\')\">\r\n            <input type=\"button\" value=\"Pomarańczowy\" onclick=\"changeBackground(\'#ff9000\')\">\r\n           <input type=\"button\" value=\"Szary\" onclick=\"changeBackground(\'#c0c0c0\')\">\r\n           <input type=\"button\" value=\"Czerwony\" onclick=\"changeBackground(\'#ff0000\')\">\r\n        </form>\r\n        <div id=\"czas\"> \r\n        <center>\r\n            <section id=\"czas\">\r\n                <div class=\"section-center flex\">\r\n                  <div>\r\n                  <h2>Aktualny czas</h2>\r\n                  <div id=\"zegarek\"></div>\r\n                </div>\r\n                <div>\r\n                  <h2>Aktualna data</h2>\r\n                  <div id=\"data\"></div>\r\n                </div> <br><br>\r\n                <div id=\"animacjaTestowa1\" class=\"test-block\">Kliknij a sie powieksze</div>\r\n                <div id=\"animacjaTestowa2\" class=\"test-block\">Najedz kursorem a sie powieksze</div>\r\n                <div id=\"animacjaTestowa3\" class=\"test-block\">Kliknij abym urosl</div>\r\n              </section>\r\n        </center>\r\n        </div>\r\n            <script>\r\n                $(\"#animacjaTestowa1\").on(\"click\", function(){\r\n                    $(this).animate({\r\n                        width:\"500px\",\r\n                        opacity:0.4,\r\n                        fontSize:\"3em\",\r\n                        borderWidth:\"10px\"\r\n             \r\n             \r\n                    },1500);\r\n             \r\n                });\r\n             \r\n                $(\"#animacjaTestowa2\").on({\r\n                    \"mouseover\" : function(){\r\n                        $(this).animate({\r\n                            width:300\r\n                        },800);\r\n                    },\r\n                    \"mouseout\" : function(){\r\n                        $(this).animate({\r\n                            width:200\r\n                        },800);\r\n                    }\r\n             \r\n                });\r\n             \r\n                $(\"#animacjaTestowa3\").on(\"click\",function(){\r\n                    if(!$(this).is(\":animated\")){\r\n                        $(this).animate({\r\n                            width:\"+=\"+50,\r\n                            height:\"+=\"+10,\r\n                            opacity:\"-=\"+0.1,\r\n                            duration:3000 //inny sposob deklaracji czasu trwania animacji\r\n                        });\r\n             \r\n                    }\r\n             \r\n                });\r\n\r\n                \r\n                </script>\r\n\r\n        \r\n    </section>\r\n</body>\r\n', 1),
(5, 'Filmy', '<div class=\"text\"> <br><br>\r\n    <center><h1 style=\"font-size: 56px\">Filmy</h1>\r\n        <p>Poniżej można obejrzeć kilka filmów przedstawiających spływ rzęką wkra w okolicy Bierzan oraz film przedstawiajacy nasze gospodarstwo</p><br>\r\n    <iframe width=\"500\" height=\"250\" src=\"https://www.youtube.com/embed/mlzM4eLPQAE\" title=\"BIEŻAŃSKIE POLE NAMIOTOWE , SPŁYWY KAJAKOWE\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\r\n    <iframe width=\"500\" height=\"250\" src=\"https://www.youtube.com/embed/1S-BO1FLkgk\" title=\"Spływ kajakowy Wkrą z Borkowa do Pomiechówka\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\r\n    <iframe width=\"500\" height=\"250\" src=\"https://www.youtube.com/embed/fRBjGWD1OyI\" title=\"Wkra spływ kajakowy\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\r\n    </center> \r\n    </div>\r\n', 1),
(6, 'Regulamin', '    <div id=\"regulamin\">\r\n        <h1><center><b>REGULAMIN</b></center></h1>\r\n        <p><b><i><center>Naszym celem jest stworzenie klimatycznego miejsca, szczególnie przyjaznego dla rodzin z dziećmi, dlatego jeżeli planujesz głośne biesiadowanie na łonie natury to możesz poczuć się zawiedziony – Turysto pamiętaj nie jesteś sam.</center></i></b></p>\r\n        <p><i>Aby zasady wypoczynku w naszym gospodarstwie agroturystycznym oraz wypożyczalni kajaków były czytelne i jasne, stworzyliśmy poniższy regulamin.</i></p>\r\n        <p><b>\"Bieżańskie pole namiotowe\"</b></p>\r\n        <ul>\r\n            <li>Pole namiotowe czynne jest w sezonie od 1 maja do 30 września.</li>\r\n            <li>Pole namiotowe jest odpłatne</li>\r\n            <li>Do przebywania na polu namiotowym uprawnione są osoby, które wcześniej uiściły opłatę za pobyt zgodnie z obowiązującym cennikiem zamieszczonym na stronie internetowej: <a href=\"#\">nazwastrony.pl</a></li>\r\n            <li>Uiszczenie opłaty za pobyt na polu namiotowym jest jednocześnie zgodą na przyjęcie warunków zawartych w niniejszym regulaminie.</li>\r\n            <li>Doba pobytowa na polu namiotowym trwa od godz.15:00 do godz.12:00 dnia następnego. Do godz. 15:00 w dniu przyjazdu oraz po godz. 12:00 w dniu wyjazdu doliczamy połowę doby.</li>\r\n            <li>Cisza nocna obowiązuje od 22.00 do 6.00, w tym czasie należy zachowywać się tak, aby nie zakłócać spokoju innym turystom oraz okolicznym mieszkańcom.</li>\r\n            <li>Turysta ma nadzór nad czworonogami, które na terenie pola namiotowego muszą być prowadzone na smyczy lub przebywać w kagańcu</li>\r\n        </ul>\r\n        <p><b>Na terenie pola namiotowego zabrania sie:</b></p>\r\n        <ul>\r\n            <ul>\r\n            <li>używania otwartego ognia w namiotach,</li>\r\n            <li>używania otwartego ognia w namiotach,</li>\r\n            <li>grillowania poza miejscem do tego wyznaczonym,</li>\r\n            <li>dewastowania infrastruktury pola namiotowego i przyległych obiektów,</li>\r\n            <li>zakłócania spokoju oraz spoczynku nocnego,</li>\r\n        </ul>\r\n        </ul>\r\n        <ul>\r\n            <li>Właściciel pola namiotowego nie ponosi odpowiedzialności za namioty, samochody ani za żadne inne rzeczy wniesione przez użytkowników na teren pola namiotowego. Każdy gość odpowiedzialny jest za swoje rzeczy osobiście.</li>\r\n            <li>Osoba przebywająca na polu namiotowym odpowiada również za wszelkie szkody wyrządzone przez siebie innym osobom lub urządzeniom znajdującym się na terenie całego gospodarstwa agroturystycznego.</li>\r\n            <li>Turysta korzystający z kąpieli w rzece oraz korzystając z trampoliny i huśtawki czyni to na własną odpowiedzialność.</li>\r\n            <li>Po skończonym pobycie osoba korzystająca z pola namiotowego zobowiązana jest do pozostawienia ładu i porządku. Pozostawione śmieci segreguje i zostawia w wyznaczonych miejscach.</li>\r\n            <li>Osoba wypożyczająca namiot, zdaje go w stanie suchym, złożonym oraz bez uszkodzeń.</li>\r\n            <li>Osoby naruszające porządek i regulamin pola, a w szczególności używające wulgaryzmów, awanturujące się, zakłócające spokój innym osobom, zostaną poproszone o opuszczenie Pola Namiotowego bez zwrotu kosztów poniesionych za opłacony pobyt. W skrajnych przypadkach osoby takie muszą również liczyć się z możliwością poniesienia odpowiedzialności karnej.</li>\r\n        </ul>\r\n        <p><b>Wypożyczalnia kajaków „AGRO-KAJAK”</b></p>\r\n        <ul>\r\n            <li>Wypożyczalnia kajaków AGRO-KAJAK nie organizuje spływów kajakowych, jedynie udostępnia sprzęt pływający na spływ, który jest organizowany we własnym zakresie przez uczestników i na własną odpowiedzialność.</li>\r\n            <li>Organizatorem spływu kajakowego jest osoba zgłaszająca potrzebę rezerwacji sprzętu.</li>\r\n            <li>Organizator spływu jest odpowiedzialny za wypożyczony sprzęt.</li>\r\n            <li>W przypadku zniszczenia, zagubienia, kradzieży sprzętu, Organizator zobowiązany jest do zwrotu jego równowartości w wysokości 100% rynkowej ceny w chwili zgłoszenia bez względu na stopień jego zamortyzowania. Za przedziurawienie poszycia kajaka w zależności od wielkości uszkodzenia pokrywa równowartość kosztów naprawy.</li>\r\n            <li>Organizator przed rozpoczęciem spływu zobowiązany jest do sprawdzenia stanu wypożyczonego sprzętu pod względem technicznym i ilościowym oraz pobraniu kamizelek asekuracyjnych równą liczbie osób wsiadających do kajaka</li>\r\n            <li>Opłaty za wypożyczenie kajaków i transport pobiera się zgodnie z cennikiem zamieszczonym na stronie internetowej: www.kajaki-wkra.pl.</li>\r\n            <li>W przypadku uczestnictwa osób nieletnich w organizowanych spływach kajakowych Organizator spływu zobowiązany jest do uzyskania zgody na uczestnictwo osoby nieletniej od prawnego opiekuna, oraz ponosi za nią pełną odpowiedzialność.</li>\r\n            <li>W czasie spływu należy zachowywać się zgodnie z dobrym obyczajem wodniaka i bezpieczeństwem uczestników spływu, w szczególności<b> nie należy:</b></li>\r\n            <ul>\r\n                <li>hałasować i zaśmiecać akwenu wodnego i nabrzeży,</li>\r\n                <li>siadać na burcie, dziobie, rufie a także w kajaku nieznajdującym się na wodzie,</li>\r\n                <li>stać i kucać w kajaku, skakać z kajaka do wody,</li>\r\n                <li>pływać bez założonej kamizelki asekuracyjnej,</li>\r\n                <li>kąpać się w kamizelkach asekuracyjnych (kapokach) ani na nich nie siadać,</li>\r\n                <li><b>spożywać napojów alkoholowych</b></li>\r\n            </ul>\r\n            <li>Wypożyczalnia kajaków AGRO-KAJAK nie ponosi odpowiedzialności: za zachowanie się uczestników na spływie, a w szczególności za szkody, jakich mogliby oni dokonać na rzecz innych osób lub firm z tytułu nieszczęśliwych wypadków, utraty zdrowia lub śmierci uczestników spływów.</li> <br>\r\n        </ul>\r\n        <p><b>Wypożyczalnia kajaków AGRO-KAJAK zapewnia</b></p>\r\n        <ul>\r\n            <li>transport sprzętu do wybranego miejsca wodowania oraz odbiór sprzętu po zakończonym spływie,</li>\r\n            <li>transport max. do 8 osób korzystających ze spływu,</li>\r\n            <li>bezpieczny i bezpłatny parking dla samochodów na czas spływu,</li>\r\n            <li>wszelką pomoc oraz ewentualny instruktaż dla początkujących kajakarzy,</li>\r\n        </ul>\r\n        <p>Po spływie kajakowym istnieje możliwość odpłatnego skorzystania z pobytu na polu namiotowym (ewentualny natrysk również płatny).Rezerwacja sprzętu w jakiejkolwiek formie jednoznaczna jest z akceptacją powyższych warunków.</p>\r\n            <p><b><i>Miłego wypoczynku życzy właścicielka gospodarstwa “Agroturystyki w Bieżanach” oraz wypożyczalni kajaków “AGRO-KAJAK” – Agnieszka Nyklewicz</i></b></p>\r\n            <img class=\"photos\"src=\"./img/8.jpg\"  alt=\"\"/>\r\n            <img class=\"photos\"src=\"./img/15.jpg\" id=\"zdj15\"  alt=\"\"/>\r\n            <img class=\"photos\"src=\"./img/9.jpg\"  alt=\"\"/>\r\n    </div>\r\n', 1),
(7, 'Kontakt', '<link rel=\"stylesheet\" href=\"https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css\">\r\n    <section class=\"text\"><br><br>\r\n        <center><h1 id=\"kont\">Kontakt</h1></center>\r\n        <div id=\"form\">\r\n            <form action=\"./index.php?id=7\" method=\"POST\" enctype=\"multipart/form-data\">\r\n            <label>Podaj imie</label><br><input type=\"text\" name=\"imie\"><br>\r\n            <label>Podaj nazwisko</label><br><input type=\"text\" name=\"nazwisko\"><br>\r\n            <label>Podaj email</label><br><input type=\"email\" name=\"email\"><br>\r\n            <label>Wiadomość</label><br><input type=\"textarea\" id=\"textarea\" name=\"ms\"><br><br>\r\n            <input type=\"submit\" value=\"Wyślij\" name=\"cont_form\" />\r\n        </form>\r\n    </div>\r\n    </section>\r\n', 1),
(8, 'Dojazd', '\r\n    <section id=\"dojazd\" class=\"text\"> <br>\r\n        <center> <h1><b>Dojazd</b></h1></center> \r\n         <p><center>Należy dojechać do miejscowości Bieżany 9 gm. Radzanów powiat Mława <br>Znajdujemy się w odległości około 110km od Warszawy, 42km od Ciechanowa, 32 km od Mławy, 12km od Strzegowa, 7km od Radzanowa.</center></p> <br>\r\n         <iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2404.869224979547!2d20.17058911526302!3d52.93278101330901!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x471c4904d49f48ef%3A0x86d3da14a1fac0bd!2sAgro-Kajak%20Bie%C5%BCany!5e0!3m2!1spl!2spl!4v1648509300662!5m2!1spl!2spl\" width=\"100%\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>\r\n     </section>\r\n', 1),
